import React from 'react';

function Lista (props) {      

    return (
        <div>
          {
             props.lomake.map(lomake => {
               return (
                 <p>
                   Nimi: { lomake.nimi }<br/>
                 </p>
               );
          })
        }
      </div>
      );
    }


  export default Lista;
